import {Link} from 'react-router-dom';


const sideBar = () => {
    return (
        <div>

            <nav>
            <ul>
            <li><Link to='/'>HOME</Link></li>
            <li><Link to='/Builds'>Builds</Link></li>
            <li><Link to='/Community'>Community</Link></li>
            </ul>
            </nav>

        </div>
    )
}

export default ideBar
